import React from "react";
import "../mainWindow/window.css";
import NewsBlock from "./newsBlock";

const News = (props) => {
  let newsWindow = props.news.news.map((el) => (
    <NewsBlock news={el}></NewsBlock>
  ));
  return (
    <div className="NewsMain">
      <div className="headNews">
        <h1>Новости</h1>
      </div>
      {newsWindow}
    </div>
  );
};

export default News;
